function generateUserID(){const e=new Date,t=e.getTime(),n=generateRandomComponent(),r=`${t}${n}`,o=hashCode(r),a=String(o).slice(0,10);return a}function generateRandomComponent(){return Math.floor(1e6*Math.random()).toString().padStart(6,"0")}function hashCode(e){let t=0;for(let n=0;n<e.length;n++){const r=e.charCodeAt(n);t=(t<<5)-t+r,t>>>=0,t|=0}let n=t.toString();return n=n.replace(/-/g,""),parseInt(n)}export default generateUserID;